import React from 'react';
import Menu from '../components/menu';

function portfolio(props) {
    return (
        <div>
            <Menu title="Portfólio - Alex Ricardo" description="Alex Ricardo desenvolvedor web" />
            <h1>Porfólio</h1>
        </div>
    );
}

export default portfolio;
